import React from 'react';
import Login from './components/Login';
const logo = require('./logo.png');

const App: React.FC = () => {
  return (
    <body>
      <div className="center">
        <img alt='logo' style={{ width: 100 }} src={String(logo)} />
      </div>
      <div className="center">
        <Login />
      </div>
    </body>
  );
}

export default App;
